from typing import List


class Solution:
    def dailyTemperatures( T: List[int]) -> List[int]:
        # l = len(T)
        # for i in range(l):
        #     for j in range(i,l+1):
        #         if T[i]<T[j]:
        #             T[i]=j-i
        #             break
        #         if T[i]>=T[j] and j==l-1:
        #             T[i]=0
        #             break
        # return T
        res = [0] * len(T)
        stack = []
        for i, t in enumerate(T):
            while stack and T[stack[-1]] < t:
                cur = stack.pop()
                res[cur] = i - cur
            stack.append(i)
        return res





